import styled from 'styled-components';

export const LinkingWrapper = styled.div`
  
ul {
    list-style-type:none;
    display: flex;
    align-items: center;
    justify-content: center;
    margin: 0;
    padding: 5px 20px 0 20px;
}
li {
    display: flex;
    position: relative;
    font-size: 12px;
    a {
        text-decoration: none;
        color: black;
    }
}
  
`
